.opr-btn-container {
  width: 1100px;
  margin: 50px auto;
}
.opr-btn-container .opr-btn:not(:first-child) {
  margin-left: 30px;
}
.report-content {
  vertical-align: middle;
  font-size: 24px;
  color: #ccc;
}
.report-content > span {
  line-height: 600px;
}
.report-content .recommend-charts {
  border: none;
}
.report-content .simple-chart {
  height: 300px;
  width: auto;
}
.report-content .chart-mask {
  display: none;
}
.report-content .changeable-component {
  transition: all 0.3s ease-in;
}
.report-content .changeable-component .description-area {
  border: none;
  resize: none;
  width: 100%;
  height: 100%;
  position: absolute;
  top: 45px;
  left: 0;
}
.report-content .changeable-component .description-pre {
  display: block;
  white-space: normal;
  word-break: break-all;
  visibility: hidden;
}
.report-content .changeable-component .mask {
  position: absolute;
  top: 0;
  right: 0;
  width: 25px;
  height: 25px;
  line-height: 25px;
  border-radius: 50%;
  cursor: pointer;
  transition: all 0.2s ease-in;
  border-radius: 5px;
}
.report-content .changeable-component .mask .mask-btn {
  position: absolute;
  right: 15px;
  top: 20px;
}
.report-content .changeable-component .mask button {
  float: right;
  margin: 10px;
  display: block;
}
.report-content .ant-table-wrapper {
  zoom: 1;
}
.report-content .ant-table-wrapper:before,
.report-content .ant-table-wrapper:after {
  content: " ";
  display: table;
}
.report-content .ant-table-wrapper:after {
  clear: both;
  visibility: hidden;
  font-size: 0;
  height: 0;
}
.report-content .ant-table {
  font-size: 12px;
  color: rgba(0, 0, 0, 0.65);
  overflow: hidden;
  position: relative;
  border-radius: 4px 4px 0 0;
  /* fix firefox scrollbar bug */
}
.report-content .ant-table-body {
  transition: opacity 0.3s ease;
}
.report-content .ant-table table {
  width: 100%;
  border-collapse: separate;
  border-spacing: 0;
  text-align: left;
  border-radius: 4px 4px 0 0;
  overflow: hidden;
}
.report-content .ant-table-thead > tr > th {
  background: #f7f7f7;
  font-weight: 500;
  transition: background .3s ease;
  text-align: left;
  color: rgba(0, 0, 0, 0.85);
}
.report-content .ant-table-thead > tr > th[colspan] {
  text-align: center;
}
.report-content .ant-table-thead > tr > th .anticon-filter,
.report-content .ant-table-thead > tr > th .ant-table-filter-icon {
  position: relative;
  margin-left: 4px;
  font-size: 12px;
  cursor: pointer;
  color: #999;
  transition: all .3s;
  width: 14px;
}
.report-content .ant-table-thead > tr > th .anticon-filter:hover,
.report-content .ant-table-thead > tr > th .ant-table-filter-icon:hover {
  color: rgba(0, 0, 0, 0.65);
}
.report-content .ant-table-thead > tr > th .anticon-filter:after,
.report-content .ant-table-thead > tr > th .ant-table-filter-icon:after {
  content: '';
  position: absolute;
  width: 14px;
  height: 50px;
  left: 0;
  top: -19px;
}
.report-content .ant-table-thead > tr > th .ant-table-filter-selected.anticon-filter {
  color: #108ee9;
}
.report-content .ant-table-tbody > tr > td {
  border-bottom: 1px solid #e9e9e9;
  transition: all .3s;
}
.report-content .ant-table-tbody > tr > td:empty:after {
  content: '.';
  visibility: hidden;
}
.report-content .ant-table-thead > tr,
.report-content .ant-table-tbody > tr {
  transition: all .3s;
}
.report-content .ant-table-thead > tr.ant-table-row-hover > td,
.report-content .ant-table-tbody > tr.ant-table-row-hover > td,
.report-content .ant-table-thead > tr:hover > td,
.report-content .ant-table-tbody > tr:hover > td {
  background: #ecf6fd;
}
.report-content .ant-table-thead > tr:hover {
  background: none;
}
.report-content .ant-table-footer {
  padding: 16px 8px;
  background: #f7f7f7;
  border-radius: 0 0 4px 4px;
  position: relative;
}
.report-content .ant-table-footer:before {
  content: '';
  height: 1px;
  background: #f7f7f7;
  position: absolute;
  top: -1px;
  width: 100%;
  left: 0;
}
.report-content .ant-table.ant-table-bordered .ant-table-footer {
  border: 1px solid #e9e9e9;
}
.report-content .ant-table-title {
  padding: 16px 0;
  position: relative;
  top: 1px;
  border-radius: 4px 4px 0 0;
}
.report-content .ant-table.ant-table-bordered .ant-table-title {
  border: 1px solid #e9e9e9;
  padding-left: 8px;
  padding-right: 8px;
}
.report-content .ant-table-title + .ant-table-content {
  position: relative;
  border-radius: 4px 4px 0 0;
  overflow: hidden;
}
.report-content .ant-table-bordered .ant-table-title + .ant-table-content,
.report-content .ant-table-bordered .ant-table-title + .ant-table-content table {
  border-radius: 0;
}
.report-content .ant-table-without-column-header .ant-table-title + .ant-table-content,
.report-content .ant-table-without-column-header table {
  border-radius: 0;
}
.report-content .ant-table-tbody > tr.ant-table-row-selected {
  background: #fafafa;
}
.report-content .ant-table-thead > tr > th.ant-table-column-sort {
  background: #eee;
}
.report-content .ant-table-thead > tr > th,
.report-content .ant-table-tbody > tr > td {
  padding: 16px 8px;
  word-break: break-all;
}
.report-content .ant-table-thead > tr > th.ant-table-selection-column-custom {
  padding-left: 16px;
  padding-right: 0;
}
.report-content .ant-table-thead > tr > th.ant-table-selection-column,
.report-content .ant-table-tbody > tr > td.ant-table-selection-column {
  text-align: center;
  min-width: 62px;
  width: 62px;
}
.report-content .ant-table-expand-icon-th,
.report-content .ant-table-row-expand-icon-cell {
  text-align: center;
  min-width: 50px;
  width: 50px;
}
.report-content .ant-table-header {
  background: #f7f7f7;
  overflow: hidden;
}
.report-content .ant-table-header table {
  border-radius: 4px 4px 0 0;
}
.report-content .ant-table-loading {
  position: relative;
}
.report-content .ant-table-loading .ant-table-body {
  background: #fff;
  opacity: 0.5;
}
.report-content .ant-table-loading .ant-table-spin-holder {
  height: 20px;
  line-height: 20px;
  left: 50%;
  top: 50%;
  margin-left: -30px;
  position: absolute;
}
.report-content .ant-table-loading .ant-table-with-pagination {
  margin-top: -20px;
}
.report-content .ant-table-loading .ant-table-without-pagination {
  margin-top: 10px;
}
.report-content .ant-table-middle .ant-table-thead > tr > th:not(.ant-table-selection-column),
.report-content .ant-table-middle .ant-table-tbody > tr > td {
  padding: 10px 8px;
}
.report-content .ant-table-middle .ant-table-title,
.report-content .ant-table-middle .ant-table-footer {
  padding: 10px 8px;
}
.report-content .ant-table-middle .ant-table-column-sorter-up:after {
  top: -13px;
  height: 13px;
}
.report-content .ant-table-middle .ant-table-column-sorter-down:after {
  bottom: -11px;
  height: 13px;
}
.report-content .ant-table-middle .ant-table-thead > tr > th .anticon-filter:after,
.report-content .ant-table-middle .ant-table-thead > tr > th .ant-table-filter-icon:after {
  height: 38px;
  top: -13px;
}
.report-content .ant-table-small {
  border: 1px solid #e9e9e9;
  border-radius: 4px;
}
.report-content .ant-table-small .ant-table-header > table,
.report-content .ant-table-small .ant-table-body > table {
  border: 0;
  padding: 0 8px;
}
.report-content .ant-table-small .ant-table-thead > tr > th {
  background: #fff;
  border-bottom: 1px solid #e9e9e9;
}
.report-content .ant-table-small .ant-table-tbody > tr > td {
  padding: 6px 8px;
}
.report-content .ant-table-small .ant-table-title,
.report-content .ant-table-small .ant-table-footer,
.report-content .ant-table-small .ant-table-thead > tr > th {
  padding: 10px 8px;
}
.report-content .ant-table-small .ant-table-title {
  border-bottom: 1px solid #e9e9e9;
  top: 0;
}
.report-content .ant-table-small .ant-table-header {
  background: #fff;
}
.report-content .ant-table-small .ant-table-placeholder,
.report-content .ant-table-small .ant-table-row:last-child td {
  border-bottom: 0;
}
.report-content .ant-table-small .ant-table-column-sorter-up:after {
  top: -14px;
  height: 13px;
}
.report-content .ant-table-small .ant-table-column-sorter-down:after {
  bottom: -11px;
  height: 13px;
}
.report-content .ant-table-small .ant-table-thead > tr > th .anticon-filter:after,
.report-content .ant-table-small .ant-table-thead > tr > th .ant-table-filter-icon:after {
  height: 39px;
  top: -14px;
}
.report-content .ant-table-column-sorter {
  position: relative;
  margin-left: 4px;
  display: inline-block;
  width: 14px;
  height: 1em;
  vertical-align: middle;
  text-align: center;
}
.report-content .ant-table-column-sorter-up,
.report-content .ant-table-column-sorter-down {
  line-height: 4px;
  display: block;
  width: 14px;
  cursor: pointer;
}
.report-content .ant-table-column-sorter-up:hover .anticon,
.report-content .ant-table-column-sorter-down:hover .anticon {
  color: rgba(0, 0, 0, 0.65);
